import React from "react";

export default props => (
  <FormControl margin="normal" required fullWidth>
    <InputLabel htmlFor="password">Password</InputLabel>
    <Input
      name="password"
      type="password"
      id="password"
      autoComplete="current-password"
    />
  </FormControl>
);
